import{d as a,c as e,o as r,V as t}from"./chunks/framework.LNvNYXX1.js";const m=t('<h1 id="симметрия" tabindex="-1">Симметрия <a class="header-anchor" href="#симметрия" aria-label="Permalink to &quot;Симметрия&quot;">​</a></h1><h2 id="bilateral-symmetry-двухсторонняя-симметрия" tabindex="-1">bilateral symmetry - двухсторонняя симметрия <a class="header-anchor" href="#bilateral-symmetry-двухсторонняя-симметрия" aria-label="Permalink to &quot;bilateral symmetry - двухсторонняя симметрия&quot;">​</a></h2><p>Двухсторонняя симметрия, или билатеральная симметрия, характеризуется тем, что организм разделен на две симметричные половины поперечной плоскостью, что позволяет дифференцировать переднюю и заднюю части и обеспечивает эффективное передвижение.</p><h2 id="asymmetric-асимметрия-не-симметричныи" tabindex="-1">asymmetric - асимметрия/не симметричный <a class="header-anchor" href="#asymmetric-асимметрия-не-симметричныи" aria-label="Permalink to &quot;asymmetric - асимметрия/не симметричный&quot;">​</a></h2><p>Рисует изображение исключая повторяющиеся симмитричные элементы</p><h2 id="radial-symmetry-радиальная-симметрия" tabindex="-1">radial symmetry - радиальная симметрия <a class="header-anchor" href="#radial-symmetry-радиальная-симметрия" aria-label="Permalink to &quot;radial symmetry - радиальная симметрия&quot;">​</a></h2><p>Этот тип симметрии характеризуется тем, что организм имеет множество плоскостей симметрии, проходящих через центр организма. Это типично для некоторых животных, таких как медузы и морские звезды.</p><h2 id="spherical-symmetry-сферическая-симметрия" tabindex="-1">spherical symmetry - Сферическая симметрия <a class="header-anchor" href="#spherical-symmetry-сферическая-симметрия" aria-label="Permalink to &quot;spherical symmetry - Сферическая симметрия&quot;">​</a></h2><p>Это подтип радиальной симметрии, где организм симметричен относительно всех направлений в трехмерном пространстве. Примерами таких организмов могут служить некоторые простейшие и бактерии.</p><h2 id="segmental-symmetry-сегментальная-симметрия" tabindex="-1">segmental symmetry - Сегментальная симметрия <a class="header-anchor" href="#segmental-symmetry-сегментальная-симметрия" aria-label="Permalink to &quot;segmental symmetry - Сегментальная симметрия&quot;">​</a></h2><p>Организм имеет две или более повторяющиеся части, которые могут быть симметричными относительно друг друга. Это типично для некоторых червей и ракообразных.</p><h2 id="spiral-symmetry-спиральная-симметрия" tabindex="-1">spiral symmetry - Спиральная симметрия <a class="header-anchor" href="#spiral-symmetry-спиральная-симметрия" aria-label="Permalink to &quot;spiral symmetry - Спиральная симметрия&quot;">​</a></h2><p>Этот тип симметрии проявляется в организмах, которые обладают спирально образованными частями или структурами. Примерами могут служить некоторые раковины моллюсков и растения.</p><h2 id="multiaxial-symmetry-многоосевая-симметрия" tabindex="-1">multiaxial symmetry - Многоосевая симметрия <a class="header-anchor" href="#multiaxial-symmetry-многоосевая-симметрия" aria-label="Permalink to &quot;multiaxial symmetry - Многоосевая симметрия&quot;">​</a></h2><p>Организм имеет более одной плоскости симметрии. Это включает различные комбинации радиальной, сегментальной и других типов симметрии.</p>',15),s=[m],n=JSON.parse('{"title":"Симметрия","description":"","frontmatter":{},"headers":[],"relativePath":"camera/symmetry.md","filePath":"camera/symmetry.md"}'),l={name:"camera/symmetry.md"},c=a({...l,setup(i){return(y,o)=>(r(),e("div",null,s))}});export{n as __pageData,c as default};
